import axios from 'axios'

const COURSE_API_URL = 'http://localhost:8080'
const WEATHER_API_URL = `${COURSE_API_URL}/weather`

class WeatherService {

    retrieveAllWeathers(sortBy, isAscending, filterBy, filterOperator) {
        //console.log('executed service')
        console.log("Sort: " +sortBy)
        console.log("filter: " + filterBy)
        const params = {
            sortBy, isAscending, filterBy, filterOperator

        }
        return axios.get(`${WEATHER_API_URL}/retrieve/fromDb`, {params});
    }
}
export default new WeatherService()
